import { Routes, Route, useNavigate, Link } from "react-router-dom";
import WebNav from "../components/navbar/WebNav";
import Home from "../pages/Home";
import NotFound from "../pages/NotFound";
import Thanks from "../pages/Thanks";
import SignIn from './SignIn';
import '../assets/App.css';

const Register = () => {
    const navigate = useNavigate(); // Importing useNavigate hook

    const handleSignInClick = () => {
        navigate('/sign-in'); // Navigate to sign-in page
    };

    return (
        <div className='booking_area w-full h-80 bg-gradient'>
            <div className="max-w-0xl w-full px-4 lg:px-0 mx-auto">
                <div className="register-container">
                    <div className="register-content">
                        <h2>Register</h2>
                        <form>
                            {/* Add your registration form fields here */}
                            <input type="text" placeholder="Username" required />
                            <input type="email" placeholder="Email" required />
                            <input type="password" placeholder="Password" required />
                            <button type="submit">Register</button>
                        </form>
                        <p>Already have an account? <Link to="/sign-in">
                            Sign in here
                            <div className="signin-button">
                                <button onClick={handleSignInClick}>Sign In</button>
                            </div>
                        </Link></p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Register;
